import React from "react";

const Cards =()=>{
 return(
     <div className="Card">
     <Cards style={{ width: '18rem' }}>
  <Cards.Img variant="top" src="holder.js/100px180" />
  <Cards.Body>
    <Cards.Title>Cards Title</Cards.Title>
    <Cards.Text>
      Some quick example text to build on the Cards title and make up the bulk of
      the Cards's content.
    </Cards.Text>
    <Button variant="primary">Go somewhere</Button>
  </Cards.Body>
</Cards>
     </div>
 )   
}

export default Cards;
